import Navbar from "./Navbar";
import Home from "./Home";
import React from "react";
import Create from "./Create";

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="content">
        <Home />
      </div>
      <Create/>
    </div>
  );
}

export default App;
